y and disaster recovery policy.'=>'PAYCOMET dispone de sistemas de Backup alojados en diferentes países para garantizar una seguridad de sistemas óptima y una alta disponibilidad. Asimismo, cuenta con una política de continuación comercial y recuperación de desastres completa.','PAYCOMET has multiple private links to banking networks that are completely independent of the Internet and which do not cross any public access network. All the information of the holder sent to banks and all the authorization messages sent in response are protected and cannot be manipulated.'=>'PAYCOMET tiene varios enlaces privados con redes bancarias que son completamente independientes de Internet y que no atraviesan ninguna red de acceso público. Toda la información del titular enviada a los bancos y todos los mensajes de autorización enviados como respuesta están protegidos y no se pueden manipular.','PAYCOMET is also subject to an annual audit according to the standards of data security of the Payment Card Industry (PCI DSS) and is a fully approved Level 1 provider of payment services, which is the highest level of compliance.'=>'PAYCOMET también se somete a una auditoría anual según los estándares de seguridad de datos del sector de tarjetas de pago (PCI DSS) y es un proveedor de servicios de pago de Nivel 1 totalmente aprobado, que es el mayor nivel de cumplimiento.','PAYCOMET is audited in access controls to production environments. The CPD where systems are hosted operate according to the requirements for Tier III centers. This ensures that safety is not put at risk at any time. It has sophisticated alarm systems, surveillance by means of closed circuit TV and security guards 24 hours a day, 7 days a week on site, as well as rigorous monitoring and maintenance. All the information about transactions and customer cards is protected even from our own employees.'=>'PAYCOMET está auditado en controles de acceso a los entornos de producción. Los CPD donde se alojan los sistemas operan conforme a los requisitos para los centros Tier III. De esta forma se garantiza que la seguridad no se ponga en riesgo en ningún momento. Se dispone de sofisticados sistemas de alarma,           vigilancia mediante circuitos cerrados de TV y vigilantes de seguridad, presentes 24 horas al día y 7 días a la semana en las instalaciones, así como de una monitorización y un mantenimiento rigurosos. Toda la información de transacciones y tarjetas de clientes está protegida incluso de nuestros propios empleados.','PAYCOMET Payment Gateway'=>'Pasarela de pagos PAYCOMET','PAYCOMET systems are reviewed quarterly by specific ISO tools, an independent Qualified Security Assessor (QSA) and a scanning vendor (ASV) approved by the payment card brands.'=>'Los sistemas de PAYCOMET se examinan trimestralmente mediante herramientas específicas ISO, un Asesor de Seguridad Cualificado (QSA) independiente y un proveedor de exploración aprobado (ASV) por las marcas de tarjetas de pago.','PAYCOMET Woocommerce'=>'PAYCOMET Woocommerce','paycometId parameter missing'=>'No se encuentra el parámetro paycometId','PaycometMerchant parameter missing'=>'Falta el parámetro paycometMerchant','Payment error: %s (%d)'=>'Error en el pago: %s (%d)','Payment gateway for credit card payment. Configuration for PayComet and alternative payment methods.'=>'Pasarela de pago para pagos con tarjeta de crédito. Configuración de PayComet y métodos de pago alternativos.','Payment method not available'=>'Método de pago no disponible','Payment not allowed in off-line authorization'=>'Pago no permitido en operaciones fuera de línea','PayPal - Operation cancelled by user.'=>'PayPal - Operación cancelada por el usuario.','PayPal - The instrument presented has been declined. Please select another one.'=>'PayPal - El método de pago seleccionado ha sido rechazado. Por favor seleccione otro distinto.','PayPal - The sum of the amount of the cart items doesn\'t match the order total amount.'=>'PayPal - La suma de los importe